Décrite dans le Lutétien du Bassin de Paris, 

Cytherella muensteri

est connue de l’Yprésien au Ludien dans les bassins de Paris et de 
Bruxelles
(
Bosquet 1852
; 
Apostolescu 1955a
; 
Keij 1957
; 
Guernet 1984
; 
Faure & Guernet 1988
), du Lutétien au Bartonien dans les bassins de Londres et du 
Hampshire
(
Haskins 1968a
; 
Keen 1978
). Elle est citée aussi dans le Lutétien du bassin d’Aquitaine (

Ducasse 
et al.
1985

). À Grignon, elle est présente dans tous les échantillons analysés (Tableaux 1 et 2).
